import React from 'react'

function Dog(props) {
    return(
        <>
            <img alt="" src={props.dog[0].image}/>
             <h2>{props.dog[0].name}</h2>
             {props.dog[0].isGoodDog ? 
                <button>Good Dog!</button> :
                <button>Bad Dog!</button>}
       </>
    )
}

export default Dog
